import "./Logs.css";
const Logs = () => {
  const logsData = [
    {
      id: "001",
      date: new Date(2021, 1, 20, 18, 30),
      desc: "学习九阳神功",
      time: 30,
    },
    {
      id: "002",
      date: new Date(2022, 2, 10, 12, 30),
      desc: "学习降龙十八掌",
      time: 20,
    },
    {
      id: "003",
      date: new Date(2022, 2, 11, 11, 30),
      desc: "学习JavaScript",
      time: 40,
    },
    {
      id: "004",
      date: new Date(2022, 2, 15, 10, 30),
      desc: "学习React",
      time: 80,
    },
  ];
  return (
    <div className="logs">
      <div className="item">
        <div className="date">
          <div className="month">4月</div>
          <div className="day">20</div>
        </div>
        <div className="content">
          <h2 className="desc">学习书法</h2>
          <div className="time">55分钟</div>
        </div>
      </div>
    </div>
  );
};
export default Logs;
